// Global variable for the pixel buffer start address
volatile int pixel_buffer_start = 0;

// Function to write a pixel to the VGA buffer
void draw_main_screen() {
			
	for (int y = 0; y < BITMAP_HEIGHT; y++) {
		for (int x = 0; x < 320; x++) {
			short int color = bitmap_data[y * BITMAP_WIDTH + x];
			plot_pixel(x, y, color);
		}
	}
	
}


int main(void) {
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    // declare other variables(not shown)

    // initialize location and direction of rectangles(not shown)
	
	for (int i = 0; i < N; i++) {

        if (i % 2 == 1){
            x_box[i] = 79 + 14*i;
            y_box[i] = 151;
            direction[i] = 2; // Start moving down    
        } else {
            x_box[i] = 79 + 14*i;
            y_box[i] = 81;
            direction[i] = -2; // Start moving up    
        }
		
	//	direction[i] = 0;
    
        prev_x_box[i] = x_box[i];
        prev_y_box[i] = y_box[i];

        colour_box[i] = 0x01b9;
    }
	
    /* set front pixel buffer to Buffer 1 */
    *(pixel_ctrl_ptr + 1) = (int) &Buffer1; // first store the address in the  back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer

    /* set back pixel buffer to Buffer 2 */
    *(pixel_ctrl_ptr + 1) = (int) &Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen(); // pixel_buffer_start points to the pixel buffer
	
	while (!game_playing){
		check_ps2_input();		
		draw_main_screen();
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	}
	
    *(pixel_ctrl_ptr + 1) = (int) &Buffer1;
    wait_for_vsync();
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); 
    *(pixel_ctrl_ptr + 1) = (int) &Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); 
    clear_screen(); 

    while (game_playing) {
									
		draw_boarder();
		draw_status();
		draw_maze();
		draw_coins();
		draw_obstacles();
		
		check_ps2_input();		
		move_and_draw_square(1); 
	
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1);

		draw_square(old_x, old_y, square_size + 2, 0xa53d);
		erase_obstacles();

    }
}


void plot_one_coin(int centerX, int centerY, short int colour){
	
    int radius = 3;
    
    for (int x = centerX - radius; x <= centerX + radius; x++) {
        for (int y = centerY - radius; y <= centerY + radius; y++) {
			
            // Skip corners to make it look like a circle
            if ((x == centerX - radius && y == centerY - radius) || 
                (x == centerX - radius && y == centerY + radius) || 
                (x == centerX + radius && y == centerY - radius) || 
                (x == centerX + radius && y == centerY + radius)) {
                continue;
            }
			
            plot_pixel(x, y, colour);
        }
    }
}

void draw_coins(){
    plot_one_coin(coin1_x, coin1_y, coin_colour_1);
	plot_one_coin(coin2_x, coin2_y, coin_colour_2);

}

void erase_obstacles(){
	
	// erase previous boxes
	for (int i = 0; i < N; i++) {
		draw_square(prev_x_box[i], prev_y_box[i], 8, 0xa53d);
				
	}

}

void draw_obstacles() {

	for (int i = 0; i < N; i++) {
		prev_x_box[i] = x_box[i];
		prev_y_box[i] = y_box[i];
		
		// Move in the current direction
		if (direction[i] == 1) x_box[i] += 2;  // Move right
		if (direction[i] == 2) y_box[i] += 2;  // Move down
		if (direction[i] == -1) x_box[i] -= 2;  // Move left
		if (direction[i] == -2) y_box[i] -= 2;  // Move up

        // Change direction at boundaries
		
		if (direction[i] == 2 && y_box[i] >= 240 - 80 - 8) direction[i] = -2; // down -> up
		if (direction[i] == -2 && y_box[i] <= 80) direction[i] = 2;  // up -> down 		
    }

    for (int i = 0; i < N; i++) {
        draw_square(x_box[i], y_box[i], 8, colour_box[i]);
    }

    
}
 


void draw_boarder() {	
	for (int i = 0; i < 15; i++){
		draw_line(0, i, 319, i, 0x0000); // Top
		draw_line(0, 239 - i, 319, 239 - i, 0x0000); // Bottom
	}
}

